import React, {Component} from 'react';

import Jumbotron from 'react-bootstrap/Jumbotron';
import Accordion from 'react-bootstrap/Accordion';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

import "./css/AboutPage.css";

class AccordionCard extends Component {
    constructor(props){
      super(props);
    }

    render(){
      return(
        <Card>
          <Card.Header>
            <Accordion.Toggle as={Button} variant="link" eventKey={this.props.key}>
              {this.props.title}
            </Accordion.Toggle>
          </Card.Header>
          <Accordion.Collapse eventKey={this.props.key}>
            <Card.Body>{this.props.body}</Card.Body>
          </Accordion.Collapse>
        </Card>
      )
    }
}

class AboutPage extends Component {
  render(){
    return(
      <div>
        <Jumbotron className="lineargradient-rainbow135">
            <div className="about-title-container" >
              <h1 className="align-item-center" style={{fontFamily:"RobotoMonoB", fontSize:"60px"}}>
                Who We Are
              </h1>
            </div>
            <div className="about-title-container">
              <h3 className="align-item-center" style={{fontFamily:"RobotoMono", fontSize:"30px"}}>
                Some nice catchy line
              </h3>
            </div>
        </Jumbotron>
        <Accordion defaultActiveKey="0">
          <AccordionCard
            title={"what we do"}
            body={"stuff about what everyone does"}
            key={"0"}
          />
        </Accordion>
      </div>
    );
  }
}

export default AboutPage;
